column2:
.{{= name }} {
    float: left;
    border: 4px solid lightblue;
    background-color: #222;
    padding: 20px;
    margin: 20px;
}

.{{= name }}:hover {
    background-color: #333;
}

.{{= name }} {
    border: 8px solid darkgray;
    padding: 20px;
    margin-bottom: 20px;
    clear: both;
    float: left;
    width: 100%;
}

.{{= name }} h2 {
    color: lightgreen;
    text-decoration: underline;
}

.{{= name }} .section {
    clear: both;
    font-size: 50%;
}

var w = $("#"+id);

var columns = view.related_rows('id','meta.column','relation_id', {
    order_by: {
        column: 'position'
    }
});


widget.sync(columns, w.find('.columns'), function(column) {
    return widget('docs:schema_column', { column: column });
});

var w = $("#"+id);

var columns = table.related_rows('id','meta.column','relation_id', {
    order_by: {
        column: 'position'
    }
});


widget.sync(columns, w.find('.columns'), function(column) {
    return widget('docs:schema_column', { column: column });
});

.{{= name }} {
    float: left;
    border: 4px dotted lightgreen;
    background-color: #222;
    padding: 20px;
    margin: 20px;
}

.{{= name }}:hover {
    background-color: #333;
}

var w = $("#"+id);

w.click(function() {

    var params = f.related_rows('id','meta.function_parameter','function_id', {
        order_by: {
            column: 'position'
        }
    });
    widget.sync(params, w.find('.params'), function(param) {
        return widget('docs:schema_function_param', { param: param }) + '&nbsp;';
    });

    w.find('.content').html(
        widget('semantics/form_field', f.field('definition'))
    );

    // unbind
    w.off('click');
});

var w = $("#"+id);

var tables = schema.related_rows('id', 'meta.table', 'schema_id', {
    order_by: {
        column: 'name'
    }
});

widget.sync(tables, w.find('.tables'), function(table) {
    return widget('docs:schema_table', { table: table });
});


var views = schema.related_rows('id', 'meta.view', 'schema_id', {
    order_by: {
        column: 'name'
    }
});

widget.sync(views, w.find('.views'), function(view) {
    return widget('docs:schema_view', { view: view });
});

var fs = schema.related_rows('id', 'meta.function', 'schema_id', {
    order_by: {
        column: 'name'
    }
});

widget.sync(fs, w.find('.functions'), function(f) {
    return widget('docs:schema_function', { f: f });
});

var w = $("#"+id);

var schemas = endpoint.schema('meta').table('schema').rows({
    where: [
        {
            name: 'name',
            op: '!=',
            value: 'information_schema'
        }, {
            name: 'name',
            op: 'not like',
            value: 'pg_%'
        }, {
            name: 'name',
            op: '!=',
            value: 'public'
        }, {
            name: 'name',
            op: '!=',
            value: 'geopuzzle'
        }, {
            name: 'name',
            op: '!=',
            value: 'beehive'
        }, {
            name: 'name',
            op: '!=',
            value: 'topology'
        }
    ]
});

widget.sync(schemas, w.find('.container'), function(schema) {
    return widget('docs:schema_schema', { schema: schema });
});

